import React, { Component } from "react";
import "./App.css";
import Section from "./components/Section";

class MyApp extends Component {
	render() {
		return (
			<div className="App">
				<Section
					heading="Trial Event"
					tagLine=""
					description=""
					day=""
					month=""
					year=""
					startTime=""
					endTime=""
					addressLine1=""
					addressLine2=""
					addressLine3=""
				/>
			</div>
		);
	}
}

export default MyApp;
